import React from 'react';


import './styles/global.css'
import 'leaflet/dist/leaflet.css'

import Routes from './routes'
import AuthContext from './contexts/AuthContext'

function App() {
  return (
    <>
      <AuthContext>
        <Routes />
      </AuthContext>
    </>
  );
}

export default App;
